TOKEN=$(gcloud auth print-access-token)
set +e

COUNTER=0

while [ $COUNTER -le 10 ]
do
    RESULT=$(curl --location --request POST "https://firestore.googleapis.com/v1/projects/$PROJECT_ID/databases/(default)/documents/car-parts?documentId=b78dfdb" \
    --header "Authorization: Bearer $TOKEN" \
    --header "Content-Type: application/json" \
    --data-raw "{
        'fields': {
            'id': {
                'stringValue': 'b78dfdb'
            },
            'description': {
                'stringValue': 'A 17\" alloy wheel'
            },
            'dateTime': {
                'stringValue': '03/19/2024 9:38:51 AM'
            },
            'partName': {
                'stringValue': '17\" alloy wheel'
            },
            'image': {
                'stringValue': 'data:image/jpeg;base64,#filename=wheel.jpeg'
            },
            'location': {
                'stringValue': '48.864716, 2.349014'
            }
        }
    }")

    if [[ $RESULT == *error* && $RESULT != *409* ]];
    then
        COUNTER=$(( $COUNTER + 1 ))
        echo "Error detected, waiting 10s and then retry $COUNTER of 11 tries..."
        sleep 10s
    else
        COUNTER=11
        echo 0
    fi
done

RESULT=$(curl --location --request POST "https://firestore.googleapis.com/v1/projects/$PROJECT_ID/databases/(default)/documents/car-part-docs?documentId=b78dfdb" \
--header "Authorization: Bearer $TOKEN" \
--header "Content-Type: application/json" \
--data-raw "{
    'fields': {
        'id': {
          'stringValue': 'b78dfdb'
        },
        'name': {
            'stringValue': '17\" alloy wheel'
        },
        'description': {
          'stringValue': 'This stunning 17-inch alloy wheel is an exquisite masterpiece of automotive design. Its sleek silhouette exudes sophistication and style, while its robust construction ensures unmatched durability on the road. The wheel\'s intricate spoke pattern is an artistic marvel, featuring a dynamic interplay of angles and curves that create a mesmerizing visual experience. The dark metallic finish adds a touch of elegance and refinement, complementing any vehicle\'s exterior color scheme. This exceptional wheel not only enhances the vehicle\'s aesthetic appeal but also provides superior performance. Its lightweight design reduces unsprung weight, contributing to better handling and improved fuel efficiency. The precise engineering and rigorous testing ensure a smooth and comfortable ride, even on uneven terrain. Whether you\'re navigating bustling city streets or embarking on adventurous road trips, this 17-inch alloy wheel will turn heads and deliver an exhilarating driving experience.'
        }
    }
}")